"use strict";(self.webpackChunkheidelbergman_site=self.webpackChunkheidelbergman_site||[]).push([[673],{7994:e=>{e.exports=JSON.parse('[{"id":"/2025/07/16/_AnwohnerInfos","metadata":{"permalink":"/blog/2025/07/16/_AnwohnerInfos","source":"@site/blog/2025-07-16_AnwohnerInfos.md","title":"Anwohner-Infos und Strecken-Sperrungen","description":"Unterkunft","date":"2025-07-16T00:00:00.000Z","formattedDate":"16. Juli 2025","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"Anwohner-Infos und Strecken-Sperrungen","authors":["orga"]},"unlisted":false,"nextItem":{"title":"Pasta-Party 2025","permalink":"/blog/2025/07/11/pasta"}},"content":"![Unterkunft](/img/banner/Anfahrt.png)\\n\\n\\nLiebe Athleten, liebe Zuschauer, liebe Anwohner,\\n\\nam Sonntag, den 27.07.2024, findet der Heidelberg Triathlob statt. Wir freuen uns auf ein gro\xdfes Event und viele Zuschauer. Damit der Wettkampf f\xfcr alle Beteiligten reibungslos abl\xe4uft, bitten wir um Verst\xe4ndnis f\xfcr die notwendigen Strecken-Sperrungen.\\n\\nDie Strecken-Sperrungen sind wie folgt:\\n\\n[Anwohnerinfos](/misc/Anwohnerzettel_2025_final.pdf)\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch!\\n\\n\ud83d\udd25RACE DAY: 27.07.2025 \ud83d\udd25"},{"id":"/2025/07/11/pasta","metadata":{"permalink":"/blog/2025/07/11/pasta","source":"@site/blog/2025-07-11-pasta.md","title":"Pasta-Party 2025","description":"Staffel","date":"2025-07-11T00:00:00.000Z","formattedDate":"11. Juli 2025","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"Pasta-Party 2025","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Anwohner-Infos und Strecken-Sperrungen","permalink":"/blog/2025/07/16/_AnwohnerInfos"},"nextItem":{"title":"Letzte Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025","permalink":"/blog/2025/05/28/_streckenchecks copy"}},"content":"![Staffel](/img/banner/Laufen.png)\\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d **Pasta-Party unterst\xfctzt von FALK** \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\n\ud83d\udcc5 Am 26.07.25 um 18:00 Uhr findet die Pasta-Party f\xfcr alle Teilnehmer des Heidelbergman Triathlons statt. \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\nDen Anmeldelink f\xfcr die Pasta-Party findet ihr hier: [Anmeldung Pasta-Party](https://docs.google.com/forms/d/1tHHbxZKvosAGmkW--T4wtbQQ8HrAj9cUo49eBbezzI0/viewform)\\n\\nVielen Dank an FALK f\xfcr die Unterst\xfctzung bei der Pasta-Party! \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\n\ud83d\udcc5 \\\\\\nDatum: 26.07.2025 \\\\\\nZeit: 18:00 Uhr \\\\\\nOrt: Neckarwiese, Heidelberg \\\\\\n\\nFreut Euch auf: \\\\\\nLeckere Pasta-Variationen \\\\\\nErfrischende Getr\xe4nke \\\\\\nEine entspannte Atmosph\xe4re zum Austausch mit anderen Teilnehmern \\\\\\nMotivation und Tipps von erfahrenen Athlet:innen \\\\ \\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d \\\\\\nKosten: \\\\\\nF\xfcr Helfer:innen: Kostenlos \\\\\\nF\xfcr Triathlet:innen: 5\u20ac pro Portion\\\\ \\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\nDie Pastaparty ist die perfekte Gelegenheit, um sich gemeinsam auf den kommenden Wettkampf einzustimmen und sich mit Gleichgesinnten auszutauschen.\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\nPS: Ihr k\xf6nnt gerne Freunde und Familie mitbringen!\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch! \ud83c\udf89\ud83c\udf89\ud83c\udf89\\n\\n![FALK](/img/sponsor/main/falk2019.jpg)"},{"id":"/2025/05/28/_streckenchecks copy","metadata":{"permalink":"/blog/2025/05/28/_streckenchecks copy","source":"@site/blog/2025-05-28_streckenchecks copy.md","title":"Letzte Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025","description":"Staffel","date":"2025-05-28T00:00:00.000Z","formattedDate":"28. Mai 2025","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"Letzte Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Pasta-Party 2025","permalink":"/blog/2025/07/11/pasta"},"nextItem":{"title":"Streckenchecks","permalink":"/blog/2025/05/28/_streckenchecks"}},"content":"![Staffel](/blog/2025_last_start_platz.png)\\n\\nWir haben viele Nachfragen erhalten, ob es noch Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025 gibt. Die gute Nachricht ist: Ja, wir haben uns entschieden, die Anmeldung bis zum 30. Juni zu verl\xe4ngern und nochmal 10 Platze freizugeben! \\n\\nSichert euch jetzt die letzten Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025! Die Anmeldung \xf6ffnet nochmal am Freitag, den 27. Juni um 18:00 Uhr aber die Pl\xe4tze sind begrenzt. Verpasst nicht die Chance, Teil dieses aufregenden Events zu sein!"}]')}}]);